import React from 'react';
import "./header.css";





const Header = () => {
  return (
   <header>
     <ul class="menu-main">
         <li><a href="">About</a></li>
         <li><a href="">Blog</a></li>
         <li><a href="">Contact</a></li>
      </ul>
   </header>
  );
}


export default Header
